import {useState} from'react'
import {Link} from 'react-router-dom';
import { AppBar, Toolbar, Button, Typography, Menu, MenuItem, } from "@material-ui/core";
import useStyles from "./styles";

const Navbar = () => {

	const [anchorEl, setAnchorEl] = useState(null);

	const classes = useStyles();



	const handleClick = (event) => {
		setAnchorEl(event.currentTarget);
	  };

	  const handleClose = () => {
		setAnchorEl(null);
	  };

	return (
		<AppBar position="fixed" className={classes.navBar}>
			<Toolbar className={classes.toolBar}>
                <Typography className={classes.logo} variant="h6">lumunge <br /><Typography variant="caption">fullstack web developer</Typography></Typography>
				<Button className={classes.navLinks} component={Link} to="/">
					Hello
				</Button>
                <Button className={classes.navLinks} component={Link} to="/resources">
					Resources
				</Button>
                <Button className={classes.navLinks} component={Link} to="/collaborate">
					Collaborate
				</Button>
				<Button className={classes.navLinks} component={Link} to="/about">
					About
				</Button>
                <Button className={classes.navLinks} onClick={() => alert("Opens up email sender to send emails")}>
					Contact
				</Button>
			</Toolbar>
			<div className={classes.responsive}>
				<Button aria-controls="simple-menu" aria-haspopup="true" onClick={handleClick}>
					Open Menu
				</Button>
				<Menu
					id="simple-menu"
					anchorEl={anchorEl}
					keepMounted
					open={Boolean(anchorEl)}
					onClose={handleClose}
				>
					<Button onClick={handleClose}>hello</Button>
					<MenuItem onClick={handleClose}>resources</MenuItem>
					<MenuItem onClick={handleClose}>collaborate</MenuItem>
					<MenuItem onClick={handleClose}>contact</MenuItem>
				</Menu>
			</div>
		</AppBar>
	);
};

export default Navbar;
